import React from 'react';

import { View,Text,StyleSheet } from 'react-native';

const Item = ()=>{

    return(
        <View style={styles.ListItem}>
            <View styles={styles.ListContent}>
                <Text>Number:</Text>
                <Text>client:</Text>
                <Text>Total: </Text>
                <Text>Statuts: </Text>
            </View>
    </View>
    );
    
}
export default Item;

const styles = StyleSheet.create({
    ListItem:{
        flexDirection:'row',
        justifyContent:'center',
        marginVertical:20
    }
})
